import React, { Component } from "react";
import "./Chat.css";

class Chat extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="chat">
        <div className="container">
          <div className="row">
            <div className="col">
              <div className="row ">
                <div className="col">
                <nav class="navbar sticky-top navbar-light bg-light">
  <a class="navbar-brand" href="#">Sticky top</a>
</nav>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Chat;
